import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from "react-router-dom";
import React from "react";
import "./App.css";
import Professeurs from "./professeur/pages/Professeurs";
import Cours from "./cours/pages/Cours";
import Cour from "./unCours/pages/UnCours";
import MainNavigation from "./shared/Navigation/MainNavigation";
import MainFooter from "./shared/MainFooter"
import Accueil from "./Accueil.js"
import Employeur from "./InfoStageEmployeur.js"

function App() {
  return (
    <Router>
      <MainNavigation />
      <main>
      <Switch>
        <Route path="/" exact>
          <Accueil />
        </Route>
        <Route path="/employeur" exact>
          <Employeur />
        </Route>
        <Route path="/professeurs" exact>
          <Professeurs />
        </Route>
        <Route path="/cours" exact>
          <Cours />
        </Route>
        <Route path="/:coursId/cours" exact>
          <Cour />
        </Route>

        <Redirect to="/" />
      </Switch>
      </main>
      <MainFooter>
      <div>
        <h3>Coordonnées du coordonnateur de stage</h3>
        <p>Sylvain Labranche,  <a href="mailto:sylvain.labranche@cmontmorency.qc.ca">sylvain.labranche@cmontmorency.qc.ca</a></p>
        <p><small>Dernière modification : 2023-05-20</small></p>
      </div>
      </MainFooter>
    </Router>
  );
}

export default App;
